window.bookSummaryJSON = "<p>Fans of Vince Flynn rejoice!</p> <p>Jake Noble, Special Forces veteran and ex-CIA operative, is living on his boat, trying to scrape together enough money for his mother's cancer treatments. When the Company offers him 150k dollars to track down a missing girl, Noble has no choice but to delve back into the seedy underbelly of Manila's sex trade.&nbsp;</p> <p>With the clock ticking on the girl's life, Noble will need all of his old skills to survive. Every move he makes unravels another deadly conspiracy and what he finds goes deeper than a random kidnapping....</p>"; 
